        roomSave.set("audioConnection", rooms[i].audioConnection ? true : false);
        roomSave.set("deptComputerAvailable", rooms[i].deptComputerAvailable ? true : false);
        roomSave.set("doubleProjectors", rooms[i].doubleProjectors ? true : false);
        roomSave.set("dvdVideoComputerOutput", rooms[i].dvdVideoComputerOutput ? true : false);
               
