function fixImageURLs(){
    var Room_Class = Parse.Object.extend("Room");
    var query = new Parse.Query(Room_Class);

    query.endsWith("imageURL", "b.jpg");
    query.find({
        success: function(results) {
            for (var i = 0; i < results.length; i++){
                var url = results[i].get("imageURL");
                var t = url.substr(0, url.lastIndexOf("/"));
                console.log(t);
                if (t.indexOf(".jpg") == -1){
                    alert("WRONG: " + url );
                    continue;
                }else{
                    results[i].set("imageURL", t);
                    results[i].save();
                }
            }
            
        },
        error: function(error) {
            alert("Error!!!");
        }
    });
    
    
}
